// Profile.js
import React from 'react';

const Profile = ({ user }) => {
    return (
        <div>
            <h2>Profile Page</h2>
            {user ? (
                <>
                    <p>Username: {user.username}</p>
                    <p>Email: {user.email}</p>
                </>
            ) : (
                <p>No user data available</p>
            )}
        </div>
    );
};

export default Profile;
